import React, { useState } from 'react'

type Props = {
  user: string
  setUser: React.Dispatch<React.SetStateAction<string>>
}


const Menu = (props: Props) => {

  const logOutHandle = (setUser: React.Dispatch<React.SetStateAction<string>>) => {
    setUser("")
  }

  return (
    <header>
      <h4>Snack</h4>
      <h4>{props.user}でログインしています</h4>
      <button onClick={logOutHandle(props.setUser)}>ログアウト</button>
    </header>
  )
}

export default Menu
